def initialize_uninitialized(sess):
    """
    一般就接在上面的函数后面用，初始化未恢复的变量。具体是：
        主函数里saver.restore(sess, checkpoint_path_keras)了之后，
        再用MaskRCNN_aux1_get_saver_to_restore_ckpt_spondylolisthesis.initialize_uninitialized(sess)。
    """
    global_vars          = tf.global_variables()
    is_not_initialized   = sess.run([tf.is_variable_initialized(var) for var in global_vars])
    not_initialized_vars = [v for (v, f) in zip(global_vars, is_not_initialized) if not f]
    print("未恢复的变量，一共%d个。他们是：" % len(not_initialized_vars))
    print ([str(i.name) for i in not_initialized_vars]) # only for testing
    if len(not_initialized_vars):
        sess.run(tf.variables_initializer(not_initialized_vars))

